from typing import *
from Tree import *

def get_mask(word):
    return sum(1 << (ord(c) - ord("a")) for c in word)


class UnionFind:
    def __init__(self, n):
        self.parent = [i for i in range(n)]
        self.weight = [1 for _ in range(n)]

    def find(self, u):
        if u != self.parent[u]:
            self.parent[u] = self.find(self.parent[u])  # Path compression
        return self.parent[u]

    def union(self, u, v):
        pu, pv = self.find(u), self.find(v)
        if pu != pv:
            if self.weight[pu] < self.weight[pv]:
                self.parent[pu] = pv
                self.weight[pv] = self.weight[pu] + self.weight[pv]
            else:
                self.parent[pv] = pu
                self.weight[pu] = self.weight[pu] + self.weight[pv]


import collections
class Solution:
    def groupStrings(self, words: List[str]) -> List[int]:
        W = [get_mask(w) for w in words]
        D = collections.defaultdict(list)
        for i, w in enumerate(W):
            D[w] = [i]

        for i, w in enumerate(W):
            for j in range(26):
                if w & 1 << j:
                    D[w - (1 << j)].append(i)

        UF = UnionFind(len(W))
        for ns in D.values():
            for a, b in zip(ns, ns[1:]):
                UF.union(a, b)

        C = collections.Counter(UF.find(i) for i in range(len(W)))
        return [len(C), max(C.values())]




